import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [message, setMessage] = useState("");
  useEffect(()=>{
    fetch("http://localhost:8000/api/v1/example")
    .then((res) => res.json())
    .then((data) => setMessage(data.message));
  }, []);

  return (
    <div className="App">
      <h1>{message}</h1>
    </div>
  );
}

export default App;
